import React from "react";
import SocialItem from "./SociallItem";

function Social(){
    return(
    
      <ul className="list-group">
                    <SocialItem 
                            media = 'Facebook' 
                            id='facebook'
                    />
                    <SocialItem 
                              media = 'Youtube' 
                              id='youtube' 
                    />
                    <SocialItem 
                              media = 'Instagram' id='instagram' />
      </ul>
);
}
export default Social
